import React, { useState } from "react";
import list from "../data";
import Cards from "./card";
import "./Products.css";

const Products = ({ handleClick }) => {
  return (
    <div>
      <br />
      <br />
      <h2> Our Products:</h2>
      <section>
        {list.map((item) => (
          <Cards key={item.id} item={item} handleClick={handleClick} />
        ))}
      </section>
    </div>
  );
};

export default Products;
